import './Buyorsell.css';
import tvl_bus from '../../Img/travel_bus.jfif';
import tvl_train from '../../Img/travel_train.jpg'
import tvl_taxi from '../../Img/travel_taxi.png';
import { NavLink } from 'react-router-dom';
import Nav from '../../Nav/Nav';

const Buyorsell = () => {
  const [Isbuy, setIsbuy] = useState(true);

  const OnclickBuy=()=>{
setIsbuy(true);

  }
  const OnclickSell=()=>{
    setIsbuy(false);
  }
  return (
    
    <div id='buyorsell'><Nav/>
        {/* <div className='buyorsell'>
             <ul>
                <li className={Isbuy?'active':'notactive'} onClick={OnclickBuy}>
                    Buy
                </li>
                <li className={Isbuy?'notactive':'active'} onClick={OnclickSell}>
                    Sell
                </li>
             </ul>
        </div> */}
        <div className='buy_tck'>
           <ul className='buy_tck_source'>
            <li>
            <NavLink to='/Ticket/Travel/Bus'>
            <img src={tvl_bus} />
            </NavLink>
            </li>
            <li>
            <NavLink to='/Ticket/Travel/Train'>
            <img src={tvl_train} />

            </NavLink>
            </li>
            <li>
            <NavLink to='/Ticket/Travel/Taxi'>
            <img src={tvl_taxi} />

            </NavLink>
            </li>
           </ul>
        </div>
        <div className='sell_tck'>

        </div>
    </div>
  )
}

export default Buyorsell
